import React, { Component } from 'react';

export default class Box extends Component {
    state = {
        isCategory: false,
    };

    renderBox() {
        if (this.props.isCategory) {
            return <li>{this.props.title}</li>;
        }
    }

    render() {
        return this.renderBox();
    }
}
